import React, { Component } from 'react';
import Navibar from "../Coponent/Navibar";
import { Link } from 'react-router-dom';
import { FiUser } from "react-icons/fi";
import { AiFillShop } from "react-icons/ai";

export default class Userafterlogin extends Component {
    render() {
        return (
            <div className="room">
                <Navibar loggedinstatus={this.props.loggedinstatus}/>
                <div className="leftnav1">
                    <FiUser />
                    <div>
                        <Link to={"./profile"} loggedinstatus={this.props.loggedinstatus}><b>Your Profile</b></Link>
                    </div> 
                    <h4>Check your personal details and upload your head image</h4>
                </div>
                <div className="leftnav1">
                    <AiFillShop />
                    <div>
                        <Link to={"./orders"} loggedinstatus={this.props.loggedinstatus}><b>Your Orders</b></Link>
                    </div> 
                    <h4>Check your order details or you can cancel it</h4>
                </div>

            </div>
        )
    }
}
